#include <vector>
#include <stdlib.h>
using namespace std;

class Solution {
public:
    vector<int> weights;
    Solution(vector<int>& w) {
        weights.push_back(w[0]);
        for ( int i = 1; i < w.size(); i++ ){
            weights.push_back(w[i] + weights[i-1]);
        }
    }
    
    int pickIndex() {
        int num = (rand() % weights.back()) + 1;
        int index = lower_bound(weights.begin(),weights.end(),num)-weights.begin();
        return index;
    }
};

